  const videoRef = useRef(null)

  const togglePlay = () => {
    if (videoRef.current) {
      if (isPlaying) {
        (videoRef.current as HTMLVideoElement).pause()
      } else {
        (videoRef.current as HTMLVideoElement).play()
      }
      setIsPlaying(!isPlaying)
    }
  }

